import * as React from 'react';
import {AppBar} from "@mui/material";



function NavBar() {
  

  return (
   <AppBar sx={{
    zIndex: "11",
    position:"fixed",
    backgroundColor:"white",
    width:"100vh",
    height:"5vw",
   }} id = "navbar"></AppBar>
  );
}
export default NavBar;
